import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
  LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, BarChart, Bar, PieChart, Pie, Cell, ResponsiveContainer, LabelList
} from 'recharts';
import { AppBar, Toolbar, Button, Container as MuiContainer, Typography } from '@mui/material';

const App = () => {
  const [data, setData] = useState([]);
  const [endpoint, setEndpoint] = useState('avgConsMake');
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    fetchData(endpoint);
  }, [endpoint]);

  const fetchData = async (endpoint) => {
    setLoading(true);
    setError(null);
    try {
      const response = await axios.get(`http://localhost:5000/api/${endpoint}`);
      console.log("Fetched data:", response.data);
      if (response.data && Array.isArray(response.data)) {
        setData(response.data);
      } else {
        throw new Error("Unexpected data format");
      }
    } catch (err) {
      setError(`Error fetching ${endpoint} data: ${err.message}`);
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  const renderChart = () => {
    if (!data || data.length === 0) {
      return <p>No data available</p>;
    }

    // 格式化数据，使所有数值保留2位小数
    const formattedData = data.map(item => {
      const formattedItem = { ...item };
      Object.keys(formattedItem).forEach(key => {
        if (typeof formattedItem[key] === 'number') {
          formattedItem[key] = parseFloat(formattedItem[key].toFixed(2));
        }
      });
      return formattedItem;
    });

    const chartType = {
      'avgConsMake': 'BarChart',
      'topEfficient': 'BarChart',
      'fuelTypeDist': 'PieChart',
      'co2ByClass': 'BarChart',
      'bestSmog': 'BarChart',
      'consByTrans': 'BarChart',
      'co2RatingPct': 'BarChart',
      'topLowCo2': 'BarChart'
    }[endpoint] || 'LineChart';

    const dataKeyMap = {
      'avgConsMake': { xKey: 'MAKE', yKey: 'AVG_CONS' },
      'topEfficient': { xKey: 'MODEL', yKey: 'COMB_CONS' },
      'fuelTypeDist': { xKey: 'FUEL_TYPE', yKey: 'COUNT_FT' },
      'co2ByClass': { xKey: 'VEH_CLASS', yKey: 'AVG_CO2' },
      'bestSmog': { xKey: 'MODEL', yKey: 'SMOG_RATING' },
      'consByTrans': { xKey: 'TRANS', yKey: 'AVG_CONS' },
      'co2RatingPct': { xKey: 'CO2_RATING', yKey: 'PERCENTAGE' },
      'topLowCo2': { xKey: 'MAKE', yKey: 'AVG_CO2' }
    };

    const { xKey, yKey } = dataKeyMap[endpoint] || { xKey: 'x', yKey: 'y' };

    const COLORS = ['#0088FE', '#00C49F', '#FFBB28', '#FF8042', '#AF19FF', '#FF19A3', '#19FFDD', '#FFA319'];

    switch (chartType) {
      case 'PieChart':
        return (
          <ResponsiveContainer width="100%" height="100%">
            <PieChart>
              <Pie data={formattedData} dataKey={yKey} nameKey={xKey} outerRadius={150} fill="#8884d8" label>
                {formattedData.map((entry, index) => (
                  <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
                ))}
              </Pie>
              <Tooltip />
              <Legend />
            </PieChart>
          </ResponsiveContainer>
        );
      case 'BarChart':
        const barSize = Math.max(40, 200 / formattedData.length); // Adjust barSize based on data length
        return (
          <ResponsiveContainer width="100%" height="100%">
            <BarChart layout="vertical" data={formattedData} margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
              <CartesianGrid stroke="#eee" />
              <XAxis type="number" />
              <YAxis type="category" dataKey={xKey} />
              <Tooltip />
              <Legend />
              <Bar dataKey={yKey} fill="#8884d8" barSize={barSize} minPointLength={10}>
                <LabelList dataKey={yKey} position="right" />
              </Bar>
            </BarChart>
          </ResponsiveContainer>
        );
      default:
        return (
          <ResponsiveContainer width="100%" height="100%">
            <LineChart data={formattedData}>
              <CartesianGrid stroke="#eee" />
              <XAxis dataKey={xKey} />
              <YAxis />
              <Tooltip />
              <Legend />
              <Line type="monotone" dataKey={yKey} stroke="#8884d8" />
            </LineChart>
          </ResponsiveContainer>
        );
    }
  };


  return (
    <div style={{ display: 'grid', gridTemplateRows: 'auto 1fr', height: '100vh' }}>
      <AppBar position="static" style={{ marginBottom: '20px' }}>
        <Toolbar>
          <Typography variant="h4" style={{ flexGrow: 1, fontWeight: 'bold' }}>
            Vehicle Data Dashboard
          </Typography>
          {['avgConsMake', 'topEfficient', 'fuelTypeDist', 'co2ByClass', 'bestSmog', 'consByTrans', 'co2RatingPct', 'topLowCo2'].map((key, index) => (
            <Button
              key={index}
              variant="contained"
              color="primary"
              style={{ marginRight: '10px', borderRadius: '20px', textTransform: 'none' }}
              onClick={() => setEndpoint(key)}
            >
              {key.split(/(?=[A-Z])/).join(' ')}
            </Button>
          ))}
        </Toolbar>
      </AppBar>
      <MuiContainer style={{ display: 'flex', flexDirection: 'column', padding: '0 20px' }}>
        {loading && <p>Loading...</p>}
        {error && <p>{error}</p>}
        <div style={{ flexGrow: 1 }}>
          {data.length > 0 && renderChart()}
        </div>
      </MuiContainer>
    </div>
  );
};

export default App;
